import Camposerviço from "../Camposerviço";

const Serviços = () => {
    return ( 
        <div className="container-serviços">
            <h3>Serviços</h3>
            <Camposerviço serviço ="SacDigital"/>
            <Camposerviço serviço ="Panfleto Online"/>
            <Camposerviço serviço ="SMSIdeal"/>
            <Camposerviço serviço ="Consulta Ideal"/>
            <Camposerviço serviço ="Whatsapp"/>
            <Camposerviço serviço ="Consulta Ideal"/>
        </div>
     );
}
 
export default Serviços;
